import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Media from "react-bootstrap/Media";
import Button from "react-bootstrap/Button"
class MainData extends React.Component {
  render() {
    return (
        <>
      <Media as="li">
        <img
          width={350}
          height={250}
          className="align-self-center mr-3"
          src="https://i.dawn.com/primary/2015/11/56488b5a8ae77.jpg"
          alt="sunset flowers"
        />
        <Media.Body className="text-center mt-sm-3">
         <Button 
         aria-controls="example-fade-text"
         
       >Click Me</Button>
            

            </Media.Body>
           </Media>


        <hr></hr>
        <Media as="li">
            <Media.Body className="text-center mt-sm-3">
            <p>
            Cras sit amet nibh libero, in gravida nulla. Nulla vel metus
            scelerisque ante sollicitudin commodo. Cras purus odio, vestibulum
            </p>
            <p>
              Donec sed odio dui. Nullam quis risus eget urna mollis ornare vel
              eu leo. Cum sociis natoque penatibus et magnis dis parturient
              montes, nascetur ridiculus mus.
            </p>
            </Media.Body>
            <img
            width ={350}
            height={250}
            className="align-self-center mr-3"
            src="https://www.loveyourlandscape.org/media/20248/city-garden-tulips-and-daffodils-000009152180_large.jpg?width=0&height=0"
            alt="flower"
            />
        </Media>
        <hr></hr>
       </>
    );
  }
}
export default MainData;
